import React, {useState, useEffect} from 'react';
import PageDefault from '../../components/pageDefault';
import {Container, Row, Column} from '../../components/grid';

function Home(){

    return(
        <PageDefault>
            <Container>
                <Row>
                   <Column grid='5'>grid 5</Column> 
                   <Column grid='2'>grid 2</Column> 
                   <Column grid='2'>grid 2</Column> 
                </Row>
            </Container>                   
        </PageDefault>
    );
}

export default Home;
